import React, { useState } from 'react';
import ReactMapGL from 'react-map-gl';

const MAPBOX_TOKEN =
	'pk.eyJ1IjoiYm95cGVyZmVyIiwiYSI6ImNrOGMwODNrbTBjMW0zZG83Ymg0NnU5MGMifQ.iuN2TaYtdyl5fpEPnC1d-g';

const Map = () => {
	const [viewPort, setViewPort] = useState({
		latitude: 37.8,
		longitude: -122.4,
		zoom: 2
	});

	return (
		<ReactMapGL
			{...viewPort}
			width='100vw'
			height='100vh'
			mapStyle='mapbox://styles/mapbox/dark-v9'
			onViewportChange={setViewPort}
			mapboxApiAccessToken={MAPBOX_TOKEN}
		/>
	);
};

export default Map;
